webpackJsonp([48,423],{2:function(e,t){e.exports="data:image/png;base64,"},39:function(e,t){e.exports="data:image/png;base64,"},260:function(e,t,s){e.exports=s.p+"_/oppgaver/src/scratch/spokelsesjakten/spokelsesjakten.d941e2.png"},1639:function(e,t,s){e.exports={frontmatter:s(656),content:s(2814)}},2814:function(e,t,s){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>Dette prosjektet er inspirert av tivolispillet <strong>Whack-a-mole</strong>, hvor man slår muldvarper ned igjen i hullene sine. I vårt spill er det spøkelsene som blir borte når vi klikker på dem. Målet er å klikke bort flest mulig i løpet av 30 sekunder.</p> <figure><img src="+s(260)+' alt=""></figure> </section> <section class=activity id=steg-1-lag-et-flyvende-spokelse> <h1 class=activity id=steg-1-lag-et-flyvende-spokelse>Steg 1: Lag et flyvende spøkelse</h1> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> Start et nytt Scratch-prosjekt.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Slett kattefiguren ved å høyreklikke på den og velge <code>slett</code></label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Endre bakgrunnen til <code>Natur/woods</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> For å legge til et spøkelse klikker du på <img src='+s(2)+' alt="Velg figur fra biblioteket">-knappen. Velg <code>Fantasi/Ghost1</code>-figuren.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Gi spøkelset navnet <code>spøkelse1</code>, ved å klikke på <code class=blockmotion>i</code> på figuren.</label></p> </li> </ul> <p>Du skal nå <strong>lage en variabel</strong> som styrer hvor fort spøkelset beveger seg. Denne kan vi senere bruke til å endre hastigheten når spillet er i gang.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> Under <code class=blocklightgrey>Skript</code>, trykk på <code class=blockdata>Data</code> og så <code>Lag en variabel</code>. Kall variabelen <code>hastighet</code>. Huk av der det står <code>For denne figuren</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> På scenen skal variabelen hete <code>spøkelse1: hastighet</code>. Hvis den bare heter <code>hastighet</code>, så slett den og legg den til en gang til.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Fjern avhukingen ved siden av variabelen, slik at den ikke vises på scenen: <img src='+s(3542)+' alt=""></label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Vi vil at spøkelset skal bevege seg når spillet starter. Det gjør vi ved å lage følgende skript:</label></p> <pre class=blocks>når grønt flagg klikkes\nsett [hastighet v] til [5]\nfor alltid\n    gå (hastighet) steg\nslutt\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test Prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Flyr spøkelset over skjermen?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> Hvorfor sitter spøkelset fast når det treffer kanten på skjermen?</label></p> </li> </ul> </section> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_11><label for=cbx_11> For å unngå at spøkelset sitter fast i kanten må vi få det til å snu når det treffer den. Dette gjøres ved å legge til klossen <code class=blockmotion>sprett tilbake ved kanten</code>. Skriptet ser da slik ut:</label></p> <pre class=blocks>når grønt flagg klikkes\nsett [hastighet v] til [5]\nfor alltid\n    gå (hastighet) steg\n    sprett tilbake ved kanten\nslutt\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_12><label for=cbx_12> For å hindre at spøkelset snur seg opp-ned, klikk på <img src='+s(39)+" alt=venstre/høyre>-knappen i spøkelsets infoboks, <code class=blockmotion>i</code>.</label></p> </li> </ul> </section> <section class=flag id=test-prosjektet-2> <h2 class=flag id=test-prosjektet-2>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_13><label for=cbx_13> Flyr spøkelset fram og tilbake?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> Flyr spøkelset riktig vei?</label></p> </li> </ul> </section> <section class=try id=ting-a-prove> <h2 class=try id=ting-a-prove>Ting å prøve</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> <strong>Endre hastighetsvariabelen</strong>, slik at spøkelset går raskere eller saktere.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Hvordan kan vi få spøkelset til å <strong>fly fortere jo lenger det flyr?</strong> (Dette er nokså vanskelig, så ikke vær bekymret hvis du ikke skjønner hvordan. Du vil få flere hint underveis.)</label></p> </li> </ul> </section> </section> <section class=activity id=steg-2-fa-spokelset-til-a-dukke-opp-og-forsvinne> <h1 class=activity id=steg-2-fa-spokelset-til-a-dukke-opp-og-forsvinne>Steg 2: Få spøkelset til å dukke opp og forsvinne</h1> <p><em>For å gjøre spillet morsommere vil vi få spøkelset til å dukke opp og forsvinne.</em></p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> Vi lager et nytt skript, som skal kjøre samtidig med skriptet som beveger på spøkelset. Det nye skriptet <strong>viser spøkelset en tilfeldig periode</strong> og <strong>gjemmer det deretter bort i en tilfeldig periode</strong>. Dette skal skje om og om igjen, frem til spillet er slutt. Slik lager du skriptet:</label></p> <pre class=blocks>når grønt flagg klikkes\nfor alltid\n    vis\n    vent (tilfeldig tall fra (3) til (5)) sekunder\n    skjul\n    vent (tilfeldig tall fra (2) til (4)) sekunder\nslutt\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-3> <h2 class=flag id=test-prosjektet-3>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> Flytter spøkelset seg fra side til side?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> Forsvinner det og dukker opp igjen helt tilfeldig?</label></p> </li> </ul> </section> <section class=try id=ting-a-prove-2> <h2 class=try id=ting-a-prove-2>Ting å prøve</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_20><label for=cbx_20> Prøv å <strong>endre tallene i koden</strong> der det står <code class=blockoperators>tilfeldig tall fra _ til _</code>. Hva skjer hvis du velger veldig store eller små tall? (Dette gir deg kanskje et nytt hint for hvordan vi skal få spøkelset til å gå fortere jo lenger man spiller.)</label></li> </ul> </section> </section> <section class=activity id=steg-3-tryll-bort-spokelset-med-et-klikk> <h1 class=activity id=steg-3-tryll-bort-spokelset-med-et-klikk>Steg 3: Tryll bort spøkelset med et klikk!</h1> <p><em>For å gjøre dette til et ordentlig spill må vi gi spilleren noe å gjøre - for eksempel å klikke bort spøkelset. Når det skjer vil vi også at det skal komme en stilig tryllelyd!</em></p> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_21><label for=cbx_21> Hent lyden <code>Elektronisk/fairydust</code> fra <code class=blocklightgrey>Lyder</code>-fanen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_22><label for=cbx_22> Lag skriptet som får <strong>spøkelset til å forsvinne</strong> når det blir klikket på:</label></p> <pre class=blocks>når denne figuren klikkes\nskjul\nspill lyden [fairydust v]\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-4> <h2 class=flag id=test-prosjektet-4>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_23><label for=cbx_23> Forsvinner spøkelset med en tryllelyd når du klikker på det?</label></li> </ul> </section> <section class=try id=ting-a-prove-3> <h2 class=try id=ting-a-prove-3>Ting å prøve</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_24><label for=cbx_24> Spør de voksne om du kan ta opp en egen lyd. Denne kan du bruke i stedet for tryllelyden.</label></li> </ul> </section> </section> <section class=activity id=steg-4-legg-til-tid-og-poeng> <h1 class=activity id=steg-4-legg-til-tid-og-poeng>Steg 4: Legg til tid og poeng</h1> <p><em>Vi har et spøkelse å trylle bort, så nå vil vi ha poeng for å gjøre det! Vi vil også ha en tidsfrist, slik at det er om å gjøre å få flest mulig poeng på denne tiden. Vi løser begge deler ved å bruke variabler.</em></p> <section class=check id=sjekkliste-5> <h2 class=check id=sjekkliste-5>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_25><label for=cbx_25> Lag en ny variabel som heter <code class=blockdata>Poeng</code>. Denne skal gjelde <code>For alle figurer</code>. Legg til en ny kloss som gjør at <code class=blockdata>Poeng</code>-variabelen økes med 1 poeng for hver gang spilleren klikker på spøkelset.</label></p> <pre class=blocks>når denne figuren klikkes\nskjul\nspill lyden [fairydust v]\nendre [Poeng v] med (1)\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_26><label for=cbx_26> Klikk på <code>Scene</code> og lag en ny variabel som heter <code>Tid</code>. La variablen vises på skjermen.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_27><label for=cbx_27> Lag et nytt skript som setter <code class=blockdata>Tid</code>-variabelen til <strong>30</strong> og <code>Poeng</code>-variablen til <strong>0</strong> når det grønne flagget klikkes.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_28><label for=cbx_28> Bruk så en <code class=blockcontrol>gjenta til</code>-kloss for å vente i <strong>1</strong> sekund og deretter redusere tiden med 1 sekund. Denne skal kjøre fram til tiden er ute. Til slutt stopper du hele spillet med en <code class=blockcontrol>stopp alle</code>-kloss.</label></p> <pre class=blocks>Når grønt flagg klikkes\nsett [Tid v] til [30]\nsett [Poeng v] til [0]\ngjenta til &lt;(tid) = [0]&gt;\n    vent (1) sekunder\n    endre [Tid v] med (-1)\nslutt\nstopp [alle v] :: control\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-5> <h2 class=flag id=test-prosjektet-5>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> </section> <section class=try id=ting-a-prove-4> <h2 class=try id=ting-a-prove-4>Ting å prøve</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_29><label for=cbx_29> Hvordan kan du få spøkelset til å gå fortere etter at spillet er i gang?</label></li> </ul> </section> <section class=save id=lagre-prosjektet> <h2 class=save id=lagre-prosjektet>Lagre prosjektet</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_30><label for=cbx_30> <strong>Bra jobba!</strong> Nå er du egentlig ferdig med spillet, men prøv deg gjerne på neste steg også.</label></li> </ul> </section> <section class=challenge id=en-ekstra-utfordring-flere-spokelser> <h2 class=challenge id=en-ekstra-utfordring-flere-spokelser>En ekstra utfordring: Flere spøkelser!</h2> <p><em>Hvis ett spøkelse er bra, må vel flere være enda bedre! La oss ha tre spøkelser flyvende rundt!</em></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_31><label for=cbx_31> <strong>Lag flere spøkelser</strong> ved å høyreklikke på det du allerede har, og så kopiere dette.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_32><label for=cbx_32> <strong>La spøkelsene få ulik størrelse</strong>. Dette gjør du ved å bruke én av knappene under. Den til venstre forstørrer figuren og den til høyre forminsker: <img src="+s(3541)+' alt=""></label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_33><label for=cbx_33> Du kan også <strong>endre spøkelsenes flyvefart</strong>. Dette gjøres i <code class=blockdata>hastighet</code>-variabelen i det øverste skriptet for hver enkelt figur.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_34><label for=cbx_34> Til slutt kan du <strong>spre spøkelsene</strong> litt bedre ut på scenen. Dette gjør du ved å klikke og dra figurene rundt i selve skjermbildet.</label></p> </li> </ul> </section> <section class=flag id=test-prosjektet-6> <h2 class=flag id=test-prosjektet-6>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_35><label for=cbx_35> Har du nå tre spøkelser som flyr fra side til side?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_36><label for=cbx_36> Som plutselig forsvinner og dukker opp igjen?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_37><label for=cbx_37> Forsvinner de når du klikker på dem?</label></p> </li> </ul> <p>Gratulerer! Da har du gjort alt riktig!</p> </section> <section class=try id=ting-a-prove-5> <h2 class=try id=ting-a-prove-5>Ting å prøve</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_38><label for=cbx_38> Hvor mange spøkelser synes du spillet fungerer best med? <strong>Legg til flere</strong> og prøv!</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_39><label for=cbx_39> Klarer du å få spøkelsene til <strong>å se forskjellige ut</strong>? Klikk på <code class=blocklightgrey>Drakter</code> og prøv deg frem. Du kan også velge noen av klossene under <code class=blocklooks>Utseende</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_40><label for=cbx_40> Kan du få spøkelsene til <strong>å bli verdt forskjellige antall poeng?</strong> Hva med å få den minste og raskeste til å gi 10 poeng?</label></p> </li> </ul> </section> <section class=save id=lagre-prosjektet-2> <h2 class=save id=lagre-prosjektet-2>Lagre prosjektet</h2> <p>Bra jobba! Nå er du ferdig, og det er på tide med litt seriøs spilling. Husk også at du kan dele spillet med vennene dine. Det gjør du ved å klikke på <code>Legg ut</code> i toppmenyen.</p> </section> </section> '},3541:function(e,t){e.exports="data:image/png;base64,"},3542:function(e,t){e.exports="data:image/png;base64,"}});